window.bookSummaryJSON = "<p><b>Juliette Contzen is a lazy, good-for-nothing princess.</b></p> <p>Overshadowed by her siblings, she's left with little to do but nap, read, and occasionally cut the falling raindrops with her sword. Spotted one day by an astonished adventurer, he insists on grading Juliette's swordsmanship, then promptly has a mental breakdown at the result.</p> <p>Soon after, Juliette is given the news that her kingdom is on the brink of bankruptcy. At the threat of being married off, the lazy princess vows to do whatever it takes to maintain her current lifestyle. Taking matters into her own hands, she escapes in the middle of the night in order to restore her kingdom's finances.</p>"; 
